शुक्रबार, फाल्गुन १३, २०७३ 
चितगोङ (हाम्रो खेलकुद) – लक्ष्मी हुन्डाई मनाङ मस्र्याङ्दी क्लबले चितगोङस्थित मोहम्मद अजिज रंगशालामा शुक्रबार अवहानी लिमिटेडसँग समूह चरणको अन्तिम खेल खेल्नेछ

